class PhoneMask {
    constructor(node, settings = {}) {
        if (!node) {
            console.warn('Нет селектора инпута для маски');
            return false;
        }
        this.node = typeof node === 'string' ? document.querySelector(node) : node;
        if (!this.node) {
            console.warn('Нет селектора инпута для маски');
            return false;
        }
        this.callbacks = settings.on || {};
        if (typeof this.callbacks.beforeInit === 'function') {
            this.callbacks.beforeInit(this);
        }
        this.im = null;
        this.initialValue = settings.initialValue || this.node.getAttribute('data-init-value') || '';
        this.countriesSettings = settings.countriesSettings ? {
            ...initialCountriesSettings,
            ...settings.countriesSettings,
        } : initialCountriesSettings;
        this.countries = settings.countries || Object.keys(this.countriesSettings);
        this.initialCountry = settings.initialCountry || this.node.getAttribute('data-init-country') || 'ru';
        this.disableMemoFlag = settings.disableMemo || false;
        this.memo = '';
        this.onKeyUp = this.setRuMask.bind(this);
        this.onPasteRuMask = this.onPasteRuMask.bind(this);

        this.createHTML();
        this.initMask();

        if (typeof this.callbacks.init === 'function') {
            this.callbacks.init(this);
        }
    }

    initMask() {
        this.im = new Inputmask({
            clearMaskOnLostFocus: true,
            placeholder: '_',
            showMaskOnHover: false,
            showMaskOnFocus: true,
            autoUnmask: true
        }).mask(this.node);
        window.Element.phonemask = undefined;
        this.node.phonemask = this;
        this.changeMask(this.initialCountry, () => {
            if (this.initialValue) {
                this.node.value = this.initialValue;
            }
        }, true);
    }

    createHTML() {
        const wrapper = document.createElement('div');
        wrapper.classList.add('js-phone-wrapper');
        this.node.parentNode.appendChild(wrapper);
        wrapper.appendChild(this.node);

        const errorSpan = document.createElement('span');
        errorSpan.className = 'js-error is-error';
        wrapper.appendChild(errorSpan);

        const countryBtn = document.createElement('div');
        countryBtn.className = 'country-btn js-country-btn';
        const countryImg = document.createElement('img');
        countryImg.setAttribute('width', '24');
        countryImg.setAttribute('height', '24');
        countryImg.setAttribute('src', 'data:image/png;base64,');
        countryBtn.appendChild(countryImg);
        wrapper.appendChild(countryBtn);
        countryImg.insertAdjacentHTML('afterend', '<svg width="16" height="16" viewBox="0 0 16 16" fill="#9e9e9e"><path fill-rule="evenodd" clip-rule="evenodd" d="M3.247 6.342a1 1 0 011.412-.095L8 9.171l3.341-2.924a1 1 0 011.318 1.506l-4 3.5a1 1 0 01-1.317 0l-4-3.5a1 1 0 01-.095-1.411z"></path></svg>');
        this.countryImg = countryImg;

        const outerWrapper = document.createElement('div');
        outerWrapper.className = 'js-field phone-outer-wrapper';
        wrapper.parentNode.appendChild(outerWrapper);
        outerWrapper.appendChild(wrapper);
        outerWrapper.appendChild(this.createCountriesHTML());

        this.wrapper = outerWrapper;
        this.bindSelectActions();
    }

    createCountriesHTML() {
        const countriesWrapper = document.createElement('div');
        countriesWrapper.className = 'country-select is-ru';
        const countriesWrapperInner = document.createElement('div');
        countriesWrapperInner.className = 'country-select__inner';
        this.countrySelect = countriesWrapper;

        countriesWrapper.appendChild(countriesWrapperInner);

        this.countries.map((el) => {
            countriesWrapperInner.appendChild(this.createCountryHTML(el));
        });

        return countriesWrapper;
    }

    createCountryHTML(countryCode) {
        const {mask, id, name, img, code} = this.countriesSettings[countryCode];

        const itemNode = document.createElement('div');
        itemNode.className = 'country-select__item js-country-phone';
        itemNode.classList.add(id);
        itemNode.setAttribute('data-mask', mask);
        itemNode.setAttribute('data-id', id);

        const itemWrapNode = document.createElement('div');
        itemWrapNode.className = 'country-select__item-wrap';
        const imgNode = document.createElement('img');
        imgNode.setAttribute('width', '24');
        imgNode.setAttribute('height', '24');
        imgNode.setAttribute('alt', name);
        imgNode.setAttribute('src', img);
        const nameNode = document.createElement('span');
        nameNode.className = 'country-select__name';
        nameNode.innerText = name;
        itemWrapNode.appendChild(imgNode);
        itemWrapNode.appendChild(nameNode);
        itemNode.appendChild(itemWrapNode);

        const codeNode = document.createElement('span');
        codeNode.className = 'country-select__code';
        codeNode.innerText = code;
        itemNode.appendChild(codeNode);

        this.bindChangeMask(itemNode, mask, id, img);

        return itemNode;
    }

    bindChangeMask(el, pmask, id, img) {
        el.addEventListener('click', (e) => {
            e.preventDefault();
            this.memoInput();
            this.changeMask(id);
            this.wrapper.querySelector('.js-country-btn').classList.remove('active');
            this.restoreMemoInput();
            if (!this.validate()) {
                this.node.focus();
            }
        });
    }

    changeMask(code, cb, doNotRunOnMaskChange) {
        const {mask: pmask, id, img, placeholder} = this.countriesSettings[code];
        this.node.setAttribute('placeholder', placeholder);
        this.node.inputmask.option({
            mask: pmask,
        });
        this.node.setAttribute('data-country', id);
        this.countrySelect.className = 'country-select is-' + id;
        this.countryImg.setAttribute('src', img);

        if (code === 'ru') {
            this.node.addEventListener('keyup', this.onKeyUp);
            this.node.addEventListener('paste', this.onPasteRuMask);
        } else {
            this.node.removeEventListener('keyup', this.onKeyUp);
            this.node.removeEventListener('paste', this.onPasteRuMask);
        }

        if (cb && typeof cb === 'function') {
            cb();
        }
        if (typeof this.callbacks.maskChange === 'function' && !doNotRunOnMaskChange) {
            this.callbacks.maskChange(this);
        }

    }

    bindSelectActions() {
        const countryBtn = this.wrapper.querySelector('.js-country-btn');
        countryBtn.addEventListener('click', (e) => {
            e.preventDefault();
            countryBtn.classList.toggle('active');
            this.countrySelect.classList.toggle('active');
        });
    }

    memoInput(value) {
        if (value) {
            this.memo = value;
            return true;
        }
        if (this.node.inputmask.hasMaskedValue()) {
            this.memo = this.node.inputmask.unmaskedvalue().length >= this.memo.length ? this.node.inputmask.unmaskedvalue() : this.memo;
            return true;
        }
        return false;
    }

    restoreMemoInput() {
        if (this.memo && !this.disableMemoFlag) {
            this.node.value = this.memo;
            return true;
        }
        this.node.value = '';
    }

    validate() {
        return this.node.inputmask.isComplete();
    }

    setValue(value) {
        this.node.value = value;
        this.memo = value;
    }

    getValue(unmasked) {
        if (unmasked) {
            return this.node.inputmask.unmaskedvalue();
        }
        return this.node.value;
    }

    clear() {
        this.setValue('');
    }

    focus() {
        this.node.focus();
    }

    updateCallbacks(obj) {
        if (!obj) {
            return false;
        }
        this.callbacks = {...this.callbacks, ...obj};
        return true;
    }

    removeCallbacks() {
        this.callbacks = {};
    }

    removeCallback(name) {
        this.callbacks = Object.keys(this.callbacks).reduce((acc, el) => {
            if (el === name) {
                return acc;
            }
            return {
                ...acc,
                [el]: this.callbacks[el],
            }
        }, {});
    }

    setRuMask() {
        if (this.getValue(true) === '89') {
            this.setValue('9');
        }
    }

    onPasteRuMask(e) {
        e.preventDefault();
        const pasteData = e.clipboardData.getData('text/plain');
        const normalizedPasteData = pasteData.replace(/^(\+)|\D/g, "$1").replace(/^(\+7)|^(8)/g, '');
        this.setValue(normalizedPasteData);
        return false;
    }
}

const validate = (form) => {
    // пока проверяем только заполненность маски телефона, остальное проверяется стандартной html5 валидацией

    const telInputs = form.querySelectorAll('input[type="tel"], .js-input-phone');
    for (const telInput of telInputs) {
        telInput.addEventListener('input', () => {
            telInput.setCustomValidity('');
        });
        if (telInput.phonemask.validate()) {
            telInput.setCustomValidity('');
            telInput.validity.valid = true;
            continue;
        }
        telInput.setCustomValidity('Неверно заполнен номер');
        telInput.validity.valid = false;
        telInput.reportValidity();
        telInput.focus();

        return false;
    }

    return true;
};

const bindModalForm = () => {
    const modal = document.querySelector('.modal__body');
    if (!modal) {
        return false;
    }
    const modalFormNode =
        modal.querySelector('.js-form') || modal.querySelector('.form_modal');

    if (!modalFormNode) {
        return false;
    }

    bindForm(modalFormNode);
    return true;
};

const bindForm = (formNode, handler = defaultHandler) => {
    if (!formNode || formNode.tagName.toLowerCase() !== 'form') {
        return false;
    }
    bindPhoneMasks(formNode);

    formNode.addEventListener('submit', (e) => {
        e.preventDefault();
        handler(formNode);
    });
};

const serialize = (form) => {
    const serialized = [];
    for (let i = 0; i < form.elements.length; i++) {
        const field = form.elements[i];
        if (!field.name
            || field.disabled
            || field.type === 'file'
            || field.type === 'reset'
            || field.type === 'submit'
            || field.type === 'button') continue;

        if (field.type === 'select-multiple') {
            for (let n = 0; n < field.options.length; n++) {
                if (!field.options[n].selected) continue;
                serialized.push(encodeURIComponent(field.name) + "=" + encodeURIComponent(field.options[n].value));
            }
        } else if ((field.type !== 'checkbox' && field.type !== 'radio') || field.checked) {
            serialized.push(encodeURIComponent(field.name) + "=" + encodeURIComponent(field.value));
        }
    }

    return serialized.join('&');
};

const defaultHandler = (form) => {

    if (!validate(form)) {
        return false;
    }
    form.classList.add('form_loading');
    // отправляем данные
    const body = form.getAttribute("enctype") === "multipart/form-data" ? new FormData(form) : serialize(form);
    const headers = form.getAttribute("enctype") === "multipart/form-data" ? {} : {
        "Content-Type": "application/x-www-form-urlencoded",
        "Accept": 'application/json',
    };
    const options = {
        method: 'POST',
        body,
        headers,
    };
    fetch(form.getAttribute('action'), options)
        .then((answer) => answer.json())
        .then((answer) => {
            const formMessage = document.createElement('div');
            formMessage.classList.add('form__message');
            formMessage.innerHTML = answer.message;
            form.append(formMessage);
            form.classList.remove('form_loading');
            if (answer.status === 'success') {
                if (form.getAttribute('data-success')) {
                    eval(form.getAttribute('data-success'));
                }
                formMessage.classList.add('form__message_success');
                setTimeout(() => {
                    form.reset();
                }, 100);
                setTimeout(() => {
                    closeModal();
                }, 8000);

            } else {
                formMessage.classList.add('form__message_error');
                setTimeout(() => {
                    formMessage.remove();
                }, 8000);
            }
            form.addEventListener('click', () => {
                removeMessage(formMessage);
            });
        })
        .catch((message) => {
            console.warn(message);
            const formMessage = document.createElement('div');
            formMessage.classList.add('form__message');
            formMessage.classList.add('form__message_error');
            formMessage.innerHTML = "Ошибка связи с серверов.<br>Попробуйте ещё раз или свяжитесь с нами по телефону <a href='tel:88005117743'>8 (800) 511-77-43</a>";
            form.append(formMessage);
            form.classList.remove('form_loading');
            setTimeout(() => {
                formMessage.remove();
            }, 10000);
            form.addEventListener('click', () => {
                removeMessage(formMessage);
            });
        });
};

const removeMessage = (messageNode) => {
    messageNode.remove();
};

const bindPhoneMasks = (root) => {
    const telInput = root.querySelectorAll('[type="tel"], .js-input-phone');

    if (!telInput.length) {
        return null;
    }

    return [...telInput].map(node => new PhoneMask(node));
};

window.addEventListener('load', () => {

    const frontTabs = (node) => {
        if (!node) {
            return false;
        }

        const checkbox = node.querySelector('.front-tabs__toggle input');

        const toggleTab = (targetIndex) => {
            node.querySelector(`.front-tabs__head-item_active`).classList.remove('front-tabs__head-item_active');
            node.querySelector(`.front-tabs__head-item[data-target="${targetIndex}"]`).classList.add('front-tabs__head-item_active');

            node.querySelector(`.front-tabs__content-item_active`).classList.remove('front-tabs__content-item_active');
            node.querySelector(`.front-tabs__content-item[data-target="${targetIndex}"]`).classList.add('front-tabs__content-item_active');

            checkbox.checked = targetIndex === '2';
        };

        for (const control of node.querySelectorAll('.front-tabs__head-item')) {
            control.addEventListener('click', (e) => {
                e.preventDefault();
                if (control.classList.contains('front-tabs__head-item_active')) {
                    return false;
                }

                toggleTab(control.getAttribute('data-target'));
            });
        }


        checkbox.addEventListener('change', () => {
            if (checkbox.checked) {
                toggleTab("2");
                return true;
            }
            toggleTab("1");
        });
    };
    frontTabs(document.querySelector('.front-tabs'));



    const bindBurger = (node) => {
        if (!node) {
            return false;
        }
        node.addEventListener('click', (e) => {
            e.preventDefault();
            document.querySelector('.header__content-wrapper').classList.toggle('header__content-wrapper_open');
        });
    };
    bindBurger(document.querySelector('.header__burger'));



    // инициализация кастомных модалок
    const on = (element, eventName, selector, fn) => {
        if (typeof element !== 'undefined' && element) {

            element.addEventListener(eventName, (event) => {

                const possibleTargets = element.querySelectorAll(selector);
                const target = event.target;

                for (let i = 0; i < possibleTargets.length; i += 1) {
                    let el = target;
                    const p = possibleTargets[i];

                    while (el && el !== element) {
                        if (el === p) {
                            return fn.call(p, event);
                        }
                        el = el.parentNode;
                    }
                }
            });
        }

    };

    on(document.body, 'click', '.js-modal', (e) => {
        e.preventDefault();
        mmodal(e.target, bindModalForm);
        e.stopPropagation();
    });

    // привязка форм
    const forms = document.querySelectorAll('.js-form');
    for (const form of forms) {
        bindForm(form);
    }

});
